import React from 'react';
import { Carousel } from 'antd';

const CarouselComponent = () => {
  const carouselStyle = {
    marginBottom: '40px', // Increased marginBottom for more space
    width: '100%', // Adjust the width as needed
    margin: '0 auto', // Center the carousel
  };

  const imgStyle = {
    width: '100%',
    height: 'auto',
    objectFit: 'cover', // Ensures the image covers the entire carousel area
  };

  // Base64 images
  const images = [
    "data:image/jpeg;base64,", // Sample base64 image



    "data:image/jpeg;base64,",
  ];

  return (
    <div className="carousel-container">
      <Carousel autoplay style={carouselStyle} dots={true} arrows={true} >
        {images.map((base64, index) => (
          <div key={index}>
            <img
              src={base64}
              alt={`League Image ${index + 1}`}
              className="carousel-image"
              style={imgStyle}
            />
          </div>
        ))}
      </Carousel>
    </div>
  );
};

export default CarouselComponent;
